import React from "react";

const Search = function() {
    

    return(
        <div className='search__block'> 
          <input 
            type="text" 
            name="text" 
            class="search" 
            placeholder="Search here!"/>
          <input 
            type="submit"
            name="submit"  
            class="submit" 
            value="Search"/>
      </div>
    )
}

export default Search;
